    "\n",
    "* **filename.split('_')[-1].split('.')[0].lower():**  Extracts the label by splitting the filename using underscores, taking the last part (assuming the label is at the end of the filename), and converting it to lowercase.\n",
    "\n",
    "* For example, if a filename is audio_happy_01.wav, the extracted label would be happy."
